INSERT INTO `games` VALUES (1,'Super Mario Bros','1492250877-supermario.png','One day (13th September 1985 in Japan, the release of this game there), Bowser kidnaps Princess Toadstool (later known as Princess Peach)because she is the only one who can turn Mushroom Retainers (later known as Toads) into bricks, etc. (which Bowser also did). Mario and Luigi, two plumbers, have to try and save Toadstool by going through eight worlds.','1492250877-Super Mario Bros.zip',1,'2017-04-15 10:07:57','2017-04-15 10:07:57','スーパーマリオブラザーズ','スーパーマリオブラザーズシリーズ（Super Mario Bros. series）は任天堂が展開しているマリオシリーズおよびスーパーマリオシリーズのうち、当社が開発・発売している2D横スクロールアクションゲームのシリーズである'),(2,'Legend of Zelda','1492251059-Legend of Zelda, The (U).png','A young boy explores a huge overworld filled with enemies and dungeons to find and rescue Princess Zelda from the evil Ganon.','1492251059-Legend of Zelda, The (USA).zip',1,'2017-04-15 10:10:59','2017-04-15 10:10:59','ゼルダの伝説','1986年の初代『ゼルダの伝説』の発売以来、長きにわたってユーザーに支持されている、任天堂のアクションアドベンチャーゲーム[8]、またはアクションRPG。初代『ゼルダの伝説』は宮本茂、手塚卓志、中郷俊彦、近藤浩治などのわずか数人によってファミリーコンピュータ ディスクシステムのローンチソフトとして開発された。\n多くのシリーズ作品の共通点として「様々なダンジョンを攻略」「剣をメインとするアクション」「アイテムによる成長」「冒険の舞台が箱庭」などがある。\n基本的なストーリーはプレイヤーの分身であるリンクがガノンなどの敵からお姫様のゼルダを助けるという物語。作品ごとに時代や主人公の設定は異なり、ストーリーも独立したものになっているため、シリーズの途中からでも理解できるものになっている。一方で「ハイラルの歴史」と称されるゲーム上の時系列は存在し、度々言及されている'),(3,'Contra','1492251484-32879-contra-nes-front-cover.jpg','Contra (魂斗羅 Kontora), distributed as Gryzor in Europe and Oceania, is a 1987 run and gun action game developed and published by Konami originally released as a coin-operated arcade game on February 20, 1987.[3] A home version was released for the Nintendo Entertainment System in 1988, along with ports for various computer formats, including the MSX2. The home versions were localized in the PAL region as Gryzor on the various computer formats and as Probotector on the NES, released later. Several Contra sequels were produced following the original game. The name of the game refers to the Contras, a group of CIA-backed Nicaraguan rebels who were frequently in the news in the United States in that period','1492251484-Contra (USA).zip',1,'2017-04-15 10:18:04','2017-04-15 10:18:04','コントラ','『魂斗羅』（コントラ）はコナミより1987年に発売されたアーケードゲーム。未来を舞台に特殊部隊『魂斗羅』の兵士が謎の軍隊と戦うアクションシューティングゲーム。ファミコン、MSXなどにも移植され、魂斗羅シリーズとしてシリーズ化される。'),(4,'Super Contra','1492251808-Super_contra.jpg','Super Contra (スーパー魂斗羅 エイリアンの逆襲 Sūpā Kontora: Eirian no Gyakushū, \"Super Contra: The Alien Strikes Back\") is a run and gun video game by Konami originally released as a coin-operated arcade game in 1988. It was ported to the Nintendo Entertainment System under the shortened title of Super C in North America and in Europe and Australia as Probotector II: Return of the Evil Forces. It is the sequel to the original Contra and part of the Contra series . The game stars Bill Rizer and Lance Bean, as they are sent to thwart another alien invasion. Both the arcade version and the NES version have been re-released in various other platforms since their original releases.','1492251808-Super Contra (Japan).zip',1,'2017-04-15 10:23:28','2017-04-15 10:23:28','スーパーコントラ','ガルカ諸島を拠点にしていたレッド・ファルコン軍の正体は、エイリアンであった。そのエイリアンたちをビルとランスら2人の「魂斗羅」が倒してから、1年が過ぎた。\n西暦2634年12月、再びエイリアンたちが地球を襲う。「魂斗羅」は再びエイリアンを倒すため、ヘリコプターに乗って出撃する'),(5,'Mega Man','1492252296-56246-Mega_Man_(USA)-10.jpg','Mega Man, alternatively written as Megaman and MegaMan, known as Rockman (ロックマン Rokkuman?) in Japan, is a video game franchise created by Capcom, starring the robot character Mega Man, or one of his many counterparts. Mega Man, released for the Nintendo Entertainment System or NES in 1987, began a series of over 50 games on multiple systems. By March 2015, the series had sold approximately thirty million copies worldwide,[1] and is often cited as one of the most renowned video game franchises of all time','1492252296-Mega Man (Europe).zip',1,'2017-04-15 10:31:36','2017-04-15 10:31:36','ロックマン','Mega Man』（メガマン）とは、カプコンのコンピュータゲームのロックマンシリーズを原作とするテレビアニメ。アメリカ合衆国と日本の共同製作（音響製作はカナダ）。第1シーズンは1994年9月11日から12月4日、第2シーズンは1995年9月10日から12月10日まで放映された。全27話'),(7,'Mega Man 2','1492252509-Megaman2_box.jpg','Mega Man 2, known in Japan as Rockman 2: Dr. Wily no Nazo (ロックマン2 Dr.ワイリーの謎 Rokkuman 2 Dr. Wairī no Nazo?, \"Rockman 2: The Mystery of Dr. Wily\"), is an action-platform game developed and published by Capcom for the Nintendo Entertainment System. It is the second installment in the original Mega Man series. The game was released in Japan in 1988 and in North America and PAL regions the following years. Mega Man 2 continues the titular protagonist\'s battle against the evil Dr. Wily and his rogue robots. The game features graphical and gameplay changes from the first Mega Man game, many of which have remained throughout the series.','1492252509-Mega Man 2 (USA).zip',1,'2017-04-15 10:35:09','2017-04-15 10:35:09','ロックマン II','Mega Man』（メガマン）とは、カプコンのコンピュータゲームのロックマンシリーズを原作とするテレビアニメ。アメリカ合衆国と日本の共同製作（音響製作はカナダ）。第1シーズンは1994年9月11日から12月4日、第2シーズンは1995年9月10日から12月10日まで放映された。全27話'),(8,'Punch Out!','1492252922-220px-Punch-out_mrdream_boxart.PNG','Punch-Out!! (パンチアウト!! Panchiauto!!?), originally released in North America as Mike Tyson\'s Punch-Out!!, is a boxing sports fighting video game for the Nintendo Entertainment System (NES) developed and published by Nintendo in 1987. Part of the Punch-Out!! series, it is a port of both the Punch-Out!! and Super Punch-Out!! arcade games (particularly the latter) with some variations.','1492252922-Punch-Out(USA).zip',1,'2017-04-15 10:42:03','2017-04-15 10:42:03','パンチアウト!!','『パンチアウト!!』は、任天堂が1980年代に発売したアーケードおよびファミリーコンピュータ（ファミコン）用ボクシングゲームである。ファミコン版には景品版と一般販売版がありタイトルは景品版は『パンチアウト!!』、一般販売版は最終対戦相手にマイク・タイソンを据えたことから『マイクタイソン・パンチアウト!!』となっている。後に景品版はWii、ニンテンドー3DS、Wii Uのバーチャルコンソールでも配信された'),(9,'Battle City','1492253862-8950.jpg','Battle City (バトルシティー Batoru Shitī?) is a multi-directional shooter video game for the Family Computer produced and published in 1985 by Namco. It is a successor to Namco\'s 1980 Tank Battalion, and would be succeeded itself by the 1991 Tank Force.[1]\r\n\r\nAn arcade version for the Nintendo VS. System would follow, and the game would eventually end up with the Virtual Console release for the Wii and Wii U. There was also a related Game Boy game of the same name dating back to 1991, who which is always published by Namco but developed by Nova Games.','1492253862-Battle City (Japan).zip',1,'2017-04-15 10:57:42','2017-04-15 10:57:42','バトルシティー','『バトルシティー』（BATTLE CITY）は、1985年9月にナムコ（後のバンダイナムコゲームス）から発売されたファミリーコンピュータ用ゲームソフト.\n'),(10,'Bomber Man','1492254123-250px-BombermanCover.jpg','Bomberman (ボンバーマン Bonbāman?) is an arcade-style maze-based video game developed by Hudson Soft. The original home computer game Bomber Man (爆弾男 Bakudan Otoko?) was released in July 1983 for the MSX, NEC PC-8801, NEC PC-6001, Sharp MZ-700 and FM-7 in Japan, and a censored version for the MSX and ZX Spectrum in Europe as Eric and the Floaters.[1][2] It had a Japanese sequel known as 3-D Bomberman, in which Bomberman navigates the maze in the first-person. In 1985, Bomberman was released for the Nintendo Entertainment System. It spawned the long-running series with many installments building on its basic gameplay.','1492254123-Bomberman (USA).zip',1,'2017-04-15 11:02:03','2017-04-15 11:02:03','三次元ボンバーマン','『三次元ボンバーマン』（さんじげんボンバーマン）は、1984年にハドソンからX1とMSX用に開発されたアクションゲーム。『3Dボンバーマン(3-D BOMBER MAN)』の名称でFM-7、PC-6001、PC-8001mkII用も発売された'),(11,'Ninja Gaiden','1492254318-Ninja_Gaiden_(NES).jpg','Ninja Gaiden[a], released in Japan as Ninja Ryūkenden (Japanese: 忍者龍剣伝?, literally \"Legend of the Ninja Dragon Sword\") and as Shadow Warriors in Europe, is a side-scrolling action-platforming video game. It was developed and published by Tecmo for the Nintendo Entertainment System (NES); its development and release coincided with the beat \'em up arcade version of the same name. It was released in December 1988 in Japan, in March 1989 in North America, and in August 1991 in Europe. It has been ported to several other platforms, including the PC Engine, the Super NES, the Virtual Console, and mobile phones.','1492254318-Shadow Warriors (Europe).zip',1,'2017-04-15 11:05:18','2017-04-15 11:05:18','ニンジャガイデン','『NINJA GAIDEN』（ニンジャガイデン）は、テクモが発売した忍者アクションアドベンチャーゲーム。開発はTeam NINJA。通称「ニンジャガ」。\n1995年を最後に終了していた忍者龍剣伝シリーズを、3Dアクションゲームとして蘇らせたXbox専用ソフト。タイトルの『NINJA GAIDEN』は元々忍者龍剣伝の海外での名称だったが、このタイトルから日本名も海外名に合わせている。日本ではプラットフォームがXboxということもあり、6万程度の売り上げだったが世界では高い評価を受けミリオンセラーとなった。キャッチコピーは「凄すぎて何が悪い」'),(12,'Super Mario World','1492254646-300px-Super_Mario_World_Box.png','Super Mario World (originally known in Japan as Super Mario World: Super Mario Bros. 4) is a main series Mario game and a launch title released for the Super Nintendo Entertainment System on November 21, 1990. As such, it is the sequel to Super Mario Bros. 3. The game was produced by Shigeru Miyamoto, featuring music composed by Koji Kondo, and graphics designed by Shigefumi Hino. An updated version was later released on the Game Boy Advance as part of the Super Mario Advance series, titled Super Mario World: Super Mario Advance 2. The original version was also re-released on the Wii and later the Wii U and New Nintendo 3DS Virtual Console. This is the first Mario game in which Yoshi, Wigglers, Monty Moles, Banzai Bills, Swoopers, and Magikoopas appear, as well as a save feature. The game also features 2D graphics with linear transformations.','1492254646-Super Mario World (USA).zip',2,'2017-04-15 11:10:46','2017-04-15 11:10:46','スーパーマリオワールド','『スーパーマリオブラザーズ4 スーパーマリオワールド』は、任天堂から1990年11月21日に発売されたスーパーファミコン用ゲームソフト。『F-ZERO』と並ぶ、スーパーファミコンのローンチタイトルの1つで、ジャンルはアクションゲーム'),(13,'Donkey Kong Country','1492255009-donkey-kong-country-snes-title-1609.gif','Donkey Kong Country is a 1994 platforming video game developed by Rare and published by Nintendo for the Super Nintendo Entertainment System. It was first released in November 1994, and under the name Super Donkey Kong (スーパードンキーコング Sūpā Donkī Kongu?) in Japan','1492255009-Donkey Kong Country (USA).zip',2,'2017-04-15 11:16:49','2017-04-15 11:16:49','ドンキーコング','ドンキーコング』（Donkey Kong） は、1981年に任天堂が発売したアーケードゲームである。1982年にはゲーム&ウオッチに、1983年にはファミリーコンピュータに移植された.\nステージ構成は、スタートが25mで、順に50m・75m・100mとなり、これらの4つの面を順番にクリアすると再び25mから始まる4面ループ制。25m・75mは画面上のレディのいる場所、50mは一番上のベルトコンベアーに到達するとクリア、100mは鉄骨の全てのボルトを抜くとクリア。樽や敵、ドンキーコングに触れたり、落下するとミスとなる。また、各ステージには制限時間が設けられており、時間内にステージをクリアしないと強制ミスになる。クリアすると、その時点での残り時間がそのまま得点に加算され、一定以上の得点になるとリトライ数が1増える'),(14,'Sonic Blast Man','1492255455-Sonic_Blast_Man_Poster.png','Sonic Blast Man (ソニックブラストマン?) is a video game franchise by Taito starring the titular superhero, Sonic Blastman. The game originally started as an arcade game, but eventually made its way to the SNES, with much different gameplay. Both versions received a sequel.\r\nThe arcade version consists of hitting the enemies and targets. In order to win, each target has a set a number of tons of resistance. Once they are depleted, they will be defeated. To hit the target, the game features a pair of gloves and a mechanical punch pad that rises when it is time to attack. The player must wear the gloves and punch the pad strongly enough to deal damage. Only three hits are allowed.','1492255455-Sonic Blast Man (Europe).zip',2,'2017-04-15 11:24:15','2017-04-15 11:24:15','ソニックブラストマン','ソニックブラストマン』とは、タイトーが1990年に販売したパンチ力を測定することでゲームを進めるゲームセンター向けのアーケードゲーム及び1992年に同社が販売したスーパーファミコン用ソフト。本項では主にアーケードゲーム版について記載する.\n'),(15,'Metal Warrior','1492255748-250px-Metal_Warriors_North_American_SNES_box_art.jpg','Metal Warriors is a 1995 action platformer video game developed by LucasArts and published by Konami for the Super Nintendo Entertainment System. The game was released exclusively in North America in February 1995.','1492255748-Metal Warriors (USA).zip',2,'2017-04-15 11:29:08','2017-04-15 11:29:08','金属戦士','Metal Warriorsは、LucasArtsによって開発され1995年のアクションプラットフォームのビデオゲームであり、KonamiによってSuper Nintendo Entertainment Systemのために発行されました。 このゲームは1995年2月に北米で独占的にリリースされました'),(16,'Soul Blazer','1492409708-soulblazer.jpg','Soul Blazer, known in Japan as Soul Blader (ソウルブレイダー Sōru Bureidā?), is an action role-playing game for the Super NES developed by Quintet and published by Enix (now Square Enix). Soul Blazer was released on January 31, 1992 in Japan, on November 27, 1992 in North America, and on January 27, 1994 in Europe. The player takes the role of The Master\'s servant, to destroy monsters and release the captured souls of a world\'s inhabitants. Soul Blazer was scored by Yukihide Takekawa.','1492409708-Soul Blazer (USA).zip',2,'2017-04-17 06:15:08','2017-04-17 06:15:08','ソウルブレイダー','ソウルブレイダー（Soul Blader）はクインテットが開発し、1992年1月31日にエニックス（現スクウェア・エニックス）が日本で発売したスーパーファミコン用アクションRPG。\nまた欧米でも、ソウルブレイザー（Soul Blazer）というタイトルにて発売されている.\nフレイル王国を統治するマグリッド王は、物欲の激しい男であった。王が何よりも欲していたのは財産。世界を手に入れるほどの黄金を手にすること。彼の欲望は、ただそれだけであった。あるとき、王は天才発明家レオの噂を耳にした。そして、ひとつの恐ろしい考えが彼の頭をよぎった。『悪魔と取り引きすれば、世界を手にするほどの富を得られるのではないか』王はレオを監禁し、悪魔を召喚する機械の制作を命じた。そしてそれはレオにとっても難しい作業ではなかった……。王が召喚した悪魔の名はデストール。王はデストールに悪魔の力で世界中の黄金を手にしたいという願いを伝えた。それに対しデストールは、恐ろしい取り引きを提案した。『生き物の命一つにつき黄金一つを交換しよう』と。王と悪魔の取り引きは成立した。その日から、一本の花、一羽の鳥というように、命が一つ、また一つと世界から消え去った。全ての生き物が消えたフレイル王国は、悪魔のしもべ、魔物たちの巣となっていった。その王も魔物に滅ぼされ、地上から生物が消えた。それから時は流れ、一人の天空人が地上の生物たちの魂を救い魔王デストールを倒すため、荒廃した地上に遣わされた'),(17,'Spider Man','1492409936-220px-Spiderman_arcade_flyer.png','Spider-Man is a side-scrolling action game developed by Western Technologies and published by Acclaim and LJN in 1995, incorporating elements from the critically acclaimed 1990s Spider-Man cartoon series. The game was released for the Genesis and the Super NES. The two versions of the game have the same basic story but have gameplay, level, and enemy differences.','1492409936-Spider-Man (USA).zip',2,'2017-04-17 06:18:57','2017-04-17 06:18:57','スパイダーマン','スパイダーマン (Spider-Man)は、マーベル・コミックが出版するアメリカンコミック『スパイダーマン』に登場する架空のスーパーヒーロー。スタン・リーとスティーブ・ディッコにより創造された'),(18,'Street Fighter II The World Of Warrior','1492410140-SF2_JPN_flyer.jpg','Street Fighter II: The World Warrior (Japanese: ストリートファイターⅡ -The World Warrior-?) is a competitive fighting game originally released for the arcades in 1991. It is the second entry in the Street Fighter series and the arcade sequel to the original Street Fighter released in 1987. It is Capcom\'s fourteenth title that runs on the CP System arcade hardware. Street Fighter II improves upon the many concepts introduced in the first game, including the use of command-based special moves and a six-button configuration, while offering players a selection of multiple playable characters, each with their own unique fighting style, and introducing a combo system and competitive multiplayer combat between two players.','1492410140-Street Fighter II - The World Warrior (USA).zip',2,'2017-04-17 06:22:20','2017-04-17 06:22:20','ストリートファイターII','『ストリートファイターII』（ストリートファイターツー、Street Fighter II）は、カプコン制作の対戦型格闘ゲームで、『ストリートファイター』の正統続編。通称『ストII』（ストツー）。1991年にアーケードゲームとして登場し、爆発的ヒットを記録した'),(19,'Naruto Ninja Council 2','1492410528-Naruto_ninja_council_2_cover.jpg','Naruto: Ninja Council 2 (known as Naruto: Saikyō Ninja Daikesshu 2 (ＮＡＲＵＴＯ－ナルト- 最強忍者大結集2 lit. \"Naruto: Great Council of the Strongest Ninja 2\"?) in Japan) is an action video game, released for Game Boy Advance and is the second installment in the Ninja Council series. It is based on the popular manga and anime series Naruto by Masashi Kishimoto and is developed by Aspect and Tomy and published by D3 Publisher and Tomy.','1492410528-Naruto - Ninja Council 2 (U).zip',3,'2017-04-17 06:28:48','2017-04-17 06:28:48','ナルト- 最強忍者大結集II','内容はテレビアニメ『NARUTO -ナルト-』の内容に基づいてゲーム化しており、一部は劇場版の内容も含んでいる。テレビアニメ『NARUTO -ナルト-』が2007年春から『NARUTO -ナルト- 疾風伝』に変更されたことに伴い、ゲームのタイトルもNARUTO -ナルト- 疾風伝から始まるものになった。'),(20,'Ninja Five','1492410835-Ninja_Cop_cover.png','Ninja Five-O, known in PAL regions as Ninja Cop, is a video game for the Nintendo Game Boy Advance, released by Konami in 2003.','1492410835-0941 - Ninja Cop (E)(Advance-Power).zip',3,'2017-04-17 06:33:55','2017-04-17 06:33:55','忍者コップ','説明はありません'),(21,'King Kong','1492411042-2233.jpg','When the beautiful Ann Darrow is kidnapped by the inhabitants of Skull Island, Jack and his team must fight their way through the island\'s prehistoric inhabitants and hostile environments, solving puzzles and fending off attackers, all in search of her. But unfortunately for them, so is a giant ape.','1492411042-2233 - King Kong (E)(Rising Sun).zip',3,'2017-04-17 06:37:22','2017-04-17 06:37:22','キングコング','説明はありません'),(22,'F1 - 2002','1492411195-1091.jpg','F1 2002 was the second last Formula 1 game released by EA before losing the official license to Sony Computer Entertainment. It featured drivers, tracks and races from the 2002 Formula 1 World Championship. The game also featured an advance telemetry feature that allowed users to view race infomation.','1492411195-1091 - F1 2002 (E)(Advance-Power).zip',3,'2017-04-17 06:39:55','2017-04-17 06:39:55','F1 - 2002','レースゲーム'),(23,'Fifa 07','1492411369-2492.jpg','FIFA 07 (also known as FIFA Football 07 and FIFA 07 Soccer) is the 2006 edition of EA Sports\' series of football simulator video games. Developed by EA Canada, it is published by Electronic Arts.\r\n\r\nIt was the last game in the FIFA series to be released for the GameCube, Xbox, and Game Boy Advance, and the first to be released for the Xbox 360. The next-generation graphics and physics engine used in the Xbox 360 version will be exclusive to the console for a period of 12 months. It was also released for PC, Nintendo DS, PlayStation Portable, and PlayStation 2.','1492411369-2492 - FIFA Soccer 07 (U)(Rising Sun).zip',3,'2017-04-17 06:42:49','2017-04-17 06:42:49','Fifa 07','FIFA07 ワールドクラスサッカー（またはFIFA07）はエレクトロニック・アーツ（EAスポーツ）から2006年9月に発売された'),(24,'Street of Rage 2','1492411508-streets-of-rage-2-gen-cover-front-eu-28764.jpg','Streets of Rage 2, released in Japan as Bare Knuckle II: The Requiem of the Deadly Battle (ベア・ナックルII 死闘への鎮魂歌 Bea Nakkuru Tsū: Shitō he no Chinkonka?), is a side-scrolling beat \'em up video game developed and published by Sega in 1992 for the Mega Drive/Genesis console. It is the second game in the Streets of Rage series, a sequel to Streets of Rage and followed by Streets of Rage 3.','1492411508-Streets of Rage 2 (USA).zip',4,'2017-04-17 06:45:08','2017-04-17 06:45:08','ストリーツ・オブ・レイジ II\n','ベア・ナックル (ストリート・オブ・レイジからのリダイレクト)\n基宏との共作で、『II』は全20曲中17曲、『III』は全27曲中16曲を担当）。 日本国外では \"Streets of Rage（ストリーツ・オブ・レイジ）\"のタイトルで販売された。これはのちにメガCD用ソフト『セガクラシック アーケードコレクション』の収録作品の1つとして、『I』のみ逆輸入されている'),(25,'Adventures of Batman & Robin','1492411714-Adventures of Batman & Robin, The (E).png','The Adventures of Batman & Robin is a series of video game adaptations released between 1994 and 1995 featuring the DC Comics characters Batman and Robin based on Batman: The Animated Series (which had been retitled The Adventures of Batman and Robin for its second season). The games were released for numerous platforms, with the Genesis, Game Gear, and Sega CD versions published by Sega while the Super NES version was published by Konami (who also produced an earlier Game Boy video game based on the show).','1492411714-Adventures of Batman & Robin, The (Europe).zip',4,'2017-04-17 06:48:35','2017-04-17 06:48:35','バットマンとロビンの冒険','説明はありません'),(26,'Wimbledon Championship Tennis','1492411868-407164-wct.jpg','A tennis game made for various Sega platforms by Sims Co.','1492411868-Wimbledon Championship Tennis (Europe).zip',4,'2017-04-17 06:51:08','2017-04-17 06:51:08','ウィンブルドン','セガプラットフォームのテニスゲーム。'),(27,'Rambo 3','1492669499-250px-Rambo_III_Coverart.png','Rambo III is a series of video games based on the film of the same name. Like in the film, their main plots center on former Vietnam-era Green Beret John Rambo being recalled up to duty one last time to rescue his former commander, Colonel Sam Trautman, who was captured during a covert operation mission in Soviet Union-controlled Afghanistan. The console versions are developed and published by Sega, the PC DOS version was developed by Ocean and published by Taito and Ocean developed and published the rest (Atari ST, Amiga, Spectrum, C64, Amstrad). Taito also released an arcade game based on the film','1492669499-Rambo III (World).zip',4,'2017-04-20 06:24:59','2017-04-20 06:24:59','ランボー III','RAMBO』（ランボー）は、セガ（後のセガ・インタラクティブ）から発売されたアーケードゲームである。ジャンルはガンシューティングゲーム.\nシルヴェスター・スタローン主演の映画『ランボー』シリーズをゲーム化した作品。プレイヤーはランボーとトラウトマン大佐となり、映画の舞台を再現したステージをサブマシンガンで突破する。3つのステージには、ゲームの進行具合に応じて、実際の映画のムービーシーンが挿入されている。'),(28,'Double dragon','1492670207-Ddragon_chirashi.jpg','Double Dragon (Japanese: 双截龍 ダブルドラゴン Hepburn: Daburu Doragon?)[5] is a 1987 beat \'em up video game developed by Technōs Japan and distributed in North America and Europe by Taito. The game is a spiritual and technological successor to Technos\' earlier beat \'em up, Nekketsu Kōha Kunio-kun (released outside of Japan by Taito as Renegade), but introduced several additions such as two-player cooperative gameplay and the ability to arm oneself with an enemy\'s weapon after disarming them. Double Dragon is considered to be one of the first successful examples of the genre, resulting in the creation of two arcade sequels and several spinoffs, as well as inspiring other companies in creating their own beat \'em ups.','1492670207-Double Dragon (USA, Europe).zip',4,'2017-04-20 06:36:47','2017-04-20 06:36:47','ダブルドラゴンシリーズ','ダブルドラゴン（DOUBLE DRAGON）シリーズは、テクノスジャパンから発売されたビデオゲームのシリーズ名。漢字表記は『双截龍』。現在はアークシステムワークスが版権を保有している');
/*!40000 ALTER TABLE `games` ENABLE KEYS */;
